import styled from "styled-components";

export const Titulo = styled.h2`
  color: yellow;
  font-size: 3em;
`;

export default function Card({onClose,name,species,gender,image}) {
   return (
      <div>
         <button onClick={onClose}>X</button>
         <Titulo>{name}</Titulo>
         <h2>{species}</h2>
         <h2>{gender}</h2>
         <img  src={image} alt="" />
      </div>
   );
}
